Cannabis sexing is pretty simple.
Around a month of vegetative growth cannabis plants will develop pre-flowers. Males develop small pollen sacks, and females will develop pistils or little hairs that can be different colors like white or pink. We separate our males from our females we want to produce big sticky buds ❤️ our other girls get pollinated to produce beautiful big striped seeds 🌱  #breeding #cannabis #cultivation
